import App from './App';
import { Routes, Route } from 'react-router-dom';
import AdmindAsh from './Dash/Main';
import RegIster from './Register/Main';
import RegIon from './Register/Region/Main';
import RegIsterPhone from './Register/Phone/Main';
import RegIsterSign from './Register/SignIn/Main';
import RegIsterSignSuccess from './Register/RegisterSuccess/Main';

// import SendMoney from './Send/Main';
// import BlockedSendMoney from './Send/Blocked/Main';

import AddMoney from './Add/Main';
import ActiF from './Actif/Main';

import LAstFx from './LastFx/Main';
import LAstFxPhone from './Phone/Main';
import AuthoRizAtion from './Authorization/Main';
import ReseT from './Reset/Main';
import RemOve from './Remove/Main';
import ClientRemOve from './Remove/Client/Main';
import DeleTe from './Remove/Delete/Main';


import WithdrAw from './Money/Withdraw/Main';
import SendfRan from './Money/FC/Main';
import SendfDollars from './Money/USD/Main';
import ValidExchAnge from './Money/ValidExFran/Main';
import ValidExchAngeDollArs from './Money/ValidExDollars/Main';
import ExchAnge from './Money/ExFran/Main';
import ExchAngeDollars from './Money/ExDollar/Main';

import SendSimpleMoney from './Money/Simple/Main';
import SendSimpleDollArMoney from './Money/SimpleDollar/Main';
import SendSimpleBlocKedMoney from './Money/SimpleBlocked/Main';

import SuccessFran from './Money/WellFC/Main';
import SuccessDollars from './Money/WellUSD/Main';
import SuccessBlocked from './Money/WellBlocked/Main';


// Add Money
import WithdrawAdd from './MoneyAdd/Withdraw/Main';
import SendfRanAdd from './MoneyAdd/FC/Main';
import SendfDollarsAdd from './MoneyAdd/USD/Main';


// Info People
import ProFil from './Profil/Main';

// URI viewer component 
export default function ReturRnURI() {
 return (
  <Routes>

   <Route path='/dash' element={<AdmindAsh />} />
   <Route path='/dash/register' element={<RegIster />} />
   <Route path='/register/region' element={<RegIon />} />
   <Route path='/register/phone' element={<RegIsterPhone />} />
   <Route path='/register/signin' element={<RegIsterSign />} />
   <Route path='/register/success' element={<RegIsterSignSuccess />} />

   <Route path='/dash/add' element={<AddMoney />} />
   <Route path='/actif' element={<ActiF />} />
   <Route path='/lastfx' element={<LAstFx />} />
   <Route path='/authorization' element={<AuthoRizAtion />} />
   <Route path='/phone/lastfx' element={<LAstFxPhone />} />

   <Route path='/' element={<App />} />
   <Route path='/reset' element={<ReseT />} />
   <Route path='/remove' element={<RemOve />} />
   <Route path='/remove/client' element={<ClientRemOve />} />
   <Route path='/remove/delete' element={<DeleTe />} />



   <Route path='/send' element={<WithdrAw />} />
   <Route path='/fc' element={<SendfRan />} />
   <Route path='/usd' element={<SendfDollars />} />
   <Route path='/valid-fc' element={<ValidExchAnge />} />
   <Route path='/valid-usd' element={<ValidExchAngeDollArs />} />
   <Route path='/exchange' element={<ExchAnge />} />
   <Route path='/exchange/usd' element={<ExchAngeDollars />} />
   <Route path='/send/franc' element={<SendSimpleMoney />} />
   <Route path='/send/dollars' element={<SendSimpleDollArMoney />} />
   <Route path='/send/thrift/franc' element={<SendSimpleBlocKedMoney />} />

   <Route path='/send/success' element={<SuccessFran />} />
   <Route path='/send/dollars/success' element={<SuccessDollars />} />
   <Route path='/send/thrift/success' element={<SuccessBlocked />} />



   <Route path='/add' element={<WithdrawAdd />} />
   <Route path='/add/fc' element={<SendfRanAdd />} />
   <Route path='/add/usd' element={<SendfDollarsAdd />} />


   <Route path='/info/people' element={<ProFil />} />


   <Route path='*' element={<App />} />
  </Routes>
 );
};
